import { GoogleMap, useLoadScript, MarkerF } from '@react-google-maps/api';



const center = {lat:1.3046688076702777, lng: 103.80008079564587}
const Maps = (lat) => {
    
    const {isLoaded} = useLoadScript({
        googleMapsApiKey: "AIzaSyCUvExdvtB4lKu2IJjTfBka8254ImunKnk",
    });
    console.log(lat);
    console.log('test');
    if(!isLoaded) return <div>Loading...</div>;
    return ( 
        <GoogleMap zoom={15} center={lat} mapContainerClassName='map-container'>
            <MarkerF position={{lat:1.3046688076702777, lng: 103.80008079564587}}/>
            <MarkerF position={{lat:44, lng: -80}}/>

            <MarkerF position={lat}/>
        </GoogleMap>
     );
}
 
export default Maps;
